import React from 'react';

import Modal from '../../components/UI/modal/modal';
import Aux from '../aux';

const withErrorHandler = (Wrapped) => {
    return (props) => {
        return (
            <Aux>
                <Modal>
                    Error;
                </Modal>
                <Wrapped {...props}/>
            </Aux>
        );
    };
}

export default withErrorHandler;
